import React, { useState } from "react";

const lakes = [
  { name: "Vialundasjön", rules: "Max 3 fiskar per dag. Endast mete tillåtet.", address: "Vialundasjön, Kumla kommun" },
  { name: "Kvarnsjön", rules: "Fiske förbjudet mellan 1 april - 31 maj. Max 2 fiskar per dag.", address: "Kvarnsjön, Kumla kommun" },
  { name: "Sickelsjön", rules: "Catch & release. Ingen nätfiske.", address: "Sickelsjön, Kumla kommun" }
];

function Rules() {
  const [selectedLake, setSelectedLake] = useState(null);

  return (
    <div style={{ padding: "20px" }}>
      <h1>Regler per sjö</h1>
      <div style={{ display: "flex", gap: "10px", marginBottom: "20px" }}>
        {lakes.map(lake => (
          <button key={lake.name} onClick={() => setSelectedLake(lake)} style={{ padding: "10px", cursor: "pointer" }}>
            {lake.name}
          </button>
        ))}
      </div>
      {selectedLake && (
        <div style={{ border: "1px solid #ccc", padding: "15px", borderRadius: "5px" }}>
          <h2>{selectedLake.name}</h2>
          <p><strong>Regler:</strong> {selectedLake.rules}</p>
          <p><strong>Adress:</strong> {selectedLake.address}</p>
        </div>
      )}
    </div>
  );
}

export default Rules;
